import React, {} from 'react';

const User = () => {
    const [isLoggedIn, setIsLoggedIn] = useState(false)

    const handleLogin = () => {
        setIsLoggedIn(true)
    }
    const handleLogout = () => {
        setIsLoggedIn(false)
    }
    return (
        <div>
            <button onClick={handleLogin}>Login</button>
            <button onClick={handleLogout}>Logout</button>
            <h3>User is {(isLoggedIn) ? 'Logged in' : 'Logged out'}</h3>
        </div>
    );
};

export default User;
